import { findByLabelText } from "@testing-library/dom";
import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(<App />, document.getElementById("root"));

mainStyles = {
  Display: flex
}

function App() {
  return (
    <main>
      <Panes style ={{mainStyles}}>
        <LeftPane>hello</LeftPane>
        <RightPane>world</RightPane>
      </Panes>
    </main>
  );
}

function Panes() {
  return <div></div>
}

function LeftPane() {
  return <div></div>
